import React, { Component } from 'react';

import * as G from './style';

class Grid extends Component {
  render() {
    const { id, direction } = this.props;

    return (
      <G.Container id={id} direction={direction}>
        {id}
      </G.Container>
    );
  }
}

export default Grid;
